Scooby-Doo, Where Are You? #28-30
Publisher:  DC Comics
Publication Date:  December 5, 2012 - February 6, 2013

Writer:  Sholly Fisch (#28, 30), Scott Gross (#29)
Penciller:  Robert Pope (#28), Scott Gross (#29), Scott Neely (#30)
Inker:  Scott McRae (#28), Scott Gross (#29), Scott Nelly (#30)
Colorist:  Jason Lewis
Letterer:  Saida Temofonte
Cover Artist:  Scott Gross
Editor:  Alex Antone

Scooby-Doo, Where Are You? #28
Oh no! A royal wraith is terrorizing a Chanukah celebration!  Can Scooby and friends save the Festival of Lights?  Find out what other yuletide ghouls lurk in this Scooby-Doo holiday special!

Scooby-Doo, Where Are You? #29
When actors start to disappear from a movie shoot, Mystery Inc. joins the cast to crack the case from the inside!  Can the gang solve this mystery before the producers pull the plug? 

Scooby-Doo, Where Are You? #30
The gang takes a trip to New Orleans and discovers a curse of zombie-fying proportions!  Can Mystery, Inc. crack the case before falling victim themselves?

